import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';

class App extends React.Component {
  constructor() {
      super()
      this.state= {
         assignmentsJSON : [],
         headerImg: "https://poster.keepcalmandposters.com/8738135.jpg"
      }
  }

  render() {
      return (
          <div>
              <header>
                  <img src={this.state.headerImg} alt="Keep Calm and Do Your Assignment" />
                  <h1>Homework Assignment Tracker</h1>
              </header>
          </div>
      )
  }
}

ReactDOM.render(
  <App/>,
  document.getElementById('root')
);
